    false,nt"url": null,nt"notes": "This investigation examined the incidence
    of skeletal malformations in metaphoric anurans developing in golf course water
    hazards. Metamorphing anurans were collected from 2 golf courses and a reference
    area in Atlantic County, New Jersey, during 2002 and 2003. Water hazard and reference
    area sediment and whole body composites were analyzed for a suite of pesticides
    and metals. The incidence of skeletal malformation was less than 1 percent at both
    courses. The observed incidence of skeletal malformations collected from the golf
    course water hazards is below that reported (5-80+ percent) in other parts of the
    United States. Pesticide residuals were not detected in sediments or whole body
    composites at concentrations of known ecological concern. The ecological implication
    of elevated aluminum and zinc levels detected in some sediment and whole body composite
    samples is unclear. The herbicide 2,4-DB (4-(2,4-dichlorophenoxy)butyric acid) was
    detected in a bullfrog whole body composite, which conflicts with the Environmental
    Protection Agency's position in the 2,4-DB Re-registration Eligibility Decision
    that 2,4-DB is not likely to bioaccumulate. Pesticide registrations and the development
    of water quality criteria need to consider the sensitive biphasic life cycles of
    anurans.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
